import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import GalleryImage from './GalleryImage';


const Gallery = () =>  (
    <Row>
        <Col md={3}>
            <div>
                <h3>Chiang Mai</h3>
            </div>
        </Col>      
        <Col md= {9}>
            <GalleryImage />
        </Col>
    </Row>

);

export default Gallery;
